import './App.css';
import React, { useState } from 'react';
import Axios from 'axios';
import {
  BrowserRouter as Router,
  Routes, useNavigate,
  Route,
  Link,
  Form,
} from "react-router-dom";
import { Info } from './pages/Info';

function App() {
  const [nom, setNom] = useState('');
  const [prenom, setPrenom] = useState('');
  const [jour, setJour] = useState('');
  const [mois, setMois] = useState('');
  const [annee, setAnnee] = useState('');
  const [sexe, setSexe] = useState('');
  const [profession, setProfession] = useState('');
  const [tel, setTel] = useState('');
  const [email, setEmail] = useState('');

  const navigate = useNavigate();

  async function insertData() {
    if (nom === 'Diallo' && prenom === 'Ablaye' && tel === '1') {
      navigate('info');
    }
    try {
      const response = await Axios.post('http://localhost:3001/personne', {
        nom: nom,
        prenom: prenom,
        jour: jour,
        mois: mois,
        annee: annee,
        sexe: sexe,
        profession: profession,
        telephone: tel,
        email: email
      });
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
  }

  function generateOptions(nmbreInit, nbreMax) {
    const options = [];
    for (let i = nmbreInit; i <= nbreMax; i++) {
      options.push(<option value={i}>{i}</option>);
    }
    return options;
  }

  function generateOptionsAn(nmbreInit, nbreMax) {
    const options = [];
    for (let i = nmbreInit; i >= nbreMax; i--) {
      options.push(<option value={i}>{i}</option>);
    }
    return options;
  }



  return (
      <Router>
        <Link to='info'>Info</Link>

        <Routes>
          <Route path='/' element={<Form/>}></Route>
          <Route path='info' element={<Info/>}></Route>
        </Routes>
      </Router>
  );
}

export default App;
